import React from 'react';

const Dashboard = () => {
  return (
    <div className="bg-gray-100 min-h-screen p-4">


      <div className="grid grid-cols-3 gap-4">
        {/* Camera & Hình ảnh */}
        <div className="bg-white p-2 shadow rounded col-span-2">
          <div className="grid grid-cols-3 gap-2">
            {[...Array(6)].map((_, idx) => (
              <div key={idx} className="bg-gray-200 h-32 flex items-center justify-center text-gray-500">
                Ảnh {idx + 1}
              </div>
            ))}
          </div>
        </div>

        {/* Thông tin */}
        <div className="bg-white p-4 shadow rounded">
          <h2 className="text-lg font-semibold text-gray-700 mb-2">Thông tin xe</h2>

          <div className="text-sm text-gray-600 space-y-1">
            <div>Biển số vào: <span className="text-black">__________</span></div>
            <div>Biển số ra: <span className="text-black">__________</span></div>
            <div>Thời gian vào: <span className="text-black">__________</span></div>
            <div>Thời gian ra: <span className="text-black">__________</span></div>
            <div>Số thẻ: <span className="text-black">__________</span></div>
            <div>Loại vé: <span className="text-black">__________</span></div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
